                         style={styles.inputStyle}
                        placeholder='City'
                        />



 <Text style={styles.inputTitleStyle}>Zip</Text>
                        <Input
                         style={styles.inputStyle}
                        placeholder='Zip'
                        />



 <Text style={styles.inputTitleStyle}>State</Text>
                        <Input
                         style={styles.inputStyle}
                        placeholder='State'
                        />

 <Text style={styles.inputTitleStyle}>Country</Text>
                        <Input
                         style={styles.inputStyle}
                        placeholder='Country'
                        />



            </View>
        );
    }
}
